import React from "react";
import { Segment } from "semantic-ui-react";
import Detail from "../Detail/Detail";
class About extends React.Component {
  render() {
    return (
      <Segment className="about">
        <div>
          <h1>About Components</h1>
        </div>

        <br />
        <br />
        <div>
          <Detail />
        </div>
      </Segment>
    );
  }
}
export default About;
